import "./intro.scss"
import { init } from 'ityped'
import { useEffect, useRef } from "react"

export default function intro() {

    const textRef = useRef();

    useEffect(()=>{
        init(textRef.current, { 
            showCursor: false, 
        strings: ["Développeur", "Web" , "Mobile" ,"Logiciel"],
    });
},[]);

    return (
        <div className="intro" id="intro">
            <div className="left">
                <div className="imgContainer">
                    <img src="/assets/moi.png"/>
                </div>
            </div>
            <div className="right">
                <div className="wrapper">
                <h2>Salut ! Je suis</h2>
                <h1>Gokhan Kabar</h1>
                <h3>Étudiant à l'Université Paris 8 <span ref={textRef}></span></h3>
            </div>
            </div>
            <a href="#portfolio">
            </a>
        </div>
    )
}
